    "quarterly-narrative-report-for-des-lacs-national-wildlife-refuge-february-march-april-1941",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Des Lacs Migratory
    Waterfowl Refuge outlines Refuge accomplishments from February through April of
    1941. The report begins by summarizing the weather conditions and water conditions
    during this period. Wildlife- including migratory birds, upland game birds, big
    game animals, furbearers, predators, rodents, and fish- is also covered. The Refuge
    development and maintenance section discusses physical developments and wildfires.
    A progress report on field investigations and applied research is also provided.
    The public relations section of the report describes recreational uses and Refuge
    visitors. Photographs are attached.",nt"license_title": "License Not Specified",nt"extras":
